pragma solidity ^0.4.19;

import "./AccessControlled.sol";

contract EtherFaucet is AccessControlled {

  event LoadEther(uint256 amount, address source);
  event ClaimEther(address dst, uint256 amount);
  event StipendChanged(uint256 newStipend, address operator);
  event LimitChanged(uint256 limit, address identity);
  event DefaultLimitChanged(uint256 limit);
  event Withdraw(uint256 amount, address dst);
  event Funded(address fundee);
  event SetFundingActive(bool state);

  mapping(address => uint256) public claims;
  mapping(address => uint256) public limits;
  mapping(address => bool) public funded;

  bool public fundingActive = true;

  uint256 public fundedAccounts = 0;

  uint256 defaultLimit = 9999;

  uint256 stipend = 0.01 ether;

  modifier onlyFirstTime(address beneficiary) {
      if (funded[beneficiary]) revert('Beneficiary already funded.');
      _;
  }

  modifier onlyActive() {
      if (!fundingActive) revert('Funding is currently disabled.');
      _;
  }

  constructor() AccessControlled() public {}

  function loadEther() public payable {
    emit LoadEther(msg.value, msg.sender);
  }

  function claimEther(address dst) public onlyIfAllowed {
    if (dst.balance >= stipend) return;
    if (limits[dst] > 0) {
      if (claims[dst] >= limits[dst]) return;
    } else {
      if (claims[dst] >= defaultLimit) return;
    }
    uint256 amount = stipend - dst.balance;
    if (address(this).balance > amount) {
      claims[dst] += amount;
      dst.transfer(amount);
      emit ClaimEther(dst, amount);
    }
  }

  function setStipend(uint256 newStipend) public onlyIfAllowed {
      stipend = newStipend;
      emit StipendChanged(newStipend, msg.sender);
  }

  function setDefaultLimit(uint256 limit) public onlyIfAllowed {
    defaultLimit = limit;
    emit DefaultLimitChanged(limit);
  }

  function setLimitForAddress(uint256 limit, address identity) public onlyIfAllowed {
    limits[identity] = limit;
    emit LimitChanged(limit, identity);
  }

  function withdraw(uint256 _amount) public onlyOwner {
    uint256 amount = _amount > address(this).balance ? address(this).balance : _amount;
    msg.sender.transfer(amount);
    emit Withdraw(amount, msg.sender);
  }

  function setFundingActive(bool state) public onlyOwner {
      fundingActive = state;
      emit SetFundingActive(state);
  }

}
